    "# Sort the data so comparisons are easier to make\n",
    "dfavgRev_ByRating = dfavgRev_ByRating.sort_values(by=[\"Revenue\"], ascending=False)\n",
    "\n",
    "# Display the results\n",
    "# Generate a bar plot showing Average Revenue by Movie Rating\n",
    "ax = dfavgRev_ByRating.plot.bar(title=\"Average Revenue by Movie Rating\", figsize=(10,7), rot=70, legend=False)\n",
    "# ax.set_ylim([0, 4])\n",
